nge = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"659876","type":"CustomJS"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"659771"},"group":null,"major_label_policy":{"id":"659940"},"minor_tick_line_color":null,"ticker":{"id":"659743"}},"id":"659742","type":"LinearAxis"},{"attributes":{},"id":"659506","type":"BasicTicker"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"659747","type":"WheelZoomTool"},{"attributes":{"fill_alpha":0.2,"fill_color":"#ffffea","hatch_alpha":0.2,"line_alpha":0.2,"line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"659569","type":"Patch"},{"attributes":{},"id":"659512","type":"UndoTool"},{"attributes":{"axis_label":"Equity","coordinates":null,"formatter":{"id":"659580"},"group":null,"major_label_policy":{"id":"659591"},"minor_tick_line_col
